import React, { useState, useEffect } from 'react';
import { FileText, Upload, Search, Clock, TrendingUp, Users, Shield, BarChart2 } from 'lucide-react';
import DashboardLayout from '../components/layout/DashboardLayout';
import axios from 'axios';

const Dashboard = () => {
  const [stats, setStats] = useState([]);
  const [recentActivity, setRecentActivity] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        // Get user ID from localStorage or context
        const userId = localStorage.getItem('userId');

        // Fetch dashboard stats
        const statsResponse = await axios.get(`http://localhost:8080/api/dashboard/stats?userId=${userId}`);
        const statsData = statsResponse.data;

        // Transform stats data to match our UI format
        const formattedStats = [
          {
            title: 'Total Documents',
            value: statsData.totalDocuments.toString(),
            change: '+12%',
            icon: FileText,
            color: 'bg-blue-100 text-blue-600',
          },
          {
            title: 'Active Contracts',
            value: statsData.activeContracts.toString(),
            change: '+3%',
            icon: Shield,
            color: 'bg-green-100 text-green-600',
          },
          {
            title: 'Team Members',
            value: statsData.teamMembers.toString(),
            change: '+2',
            icon: Users,
            color: 'bg-purple-100 text-purple-600',
          },
          {
            title: 'Analytics Score',
            value: `${statsData.analyticsScore}%`,
            change: '+5%',
            icon: BarChart2,
            color: 'bg-orange-100 text-orange-600',
          },
        ];

        setStats(formattedStats);

        // Fetch recent activity
        const activityResponse = await axios.get(`http://localhost:8080/api/dashboard/activity?userId=${userId}`);
        setRecentActivity(activityResponse.data);

        setLoading(false);
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  const quickLinks = [
    {
      title: 'Upload Document',
      description: 'Add new legal document',
      icon: Upload,
      link: '/documents',
    },
    {
      title: 'Search Terms',
      description: 'Find legal definitions',
      icon: Search,
      link: '/glossary',
    },
    {
      title: 'Recent Activity',
      description: 'View your latest actions',
      icon: Clock,
      link: '/documents',
    },
  ];

  if (loading) {
    return (
      <DashboardLayout>
        <div className="flex items-center justify-center h-screen">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary"></div>
        </div>
      </DashboardLayout>
    );
  }

  return (
    <DashboardLayout>
      <div className="flex flex-wrap justify-between gap-3 mb-8">
        <div className="flex min-w-72 flex-col gap-3">
          <h1 className="text-3xl font-bold text-gray-900">Welcome back</h1>
          <p className="text-gray-600">Here's what's happening with your legal documents</p>
        </div>
      </div>

      {/* Stats Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
        {stats.map((stat, index) => (
          <div key={index} className="bg-white rounded-xl border border-gray-200 p-6">
            <div className="flex items-center justify-between mb-4">
              <div className={`w-12 h-12 rounded-lg ${stat.color} flex items-center justify-center`}>
                <stat.icon className="w-6 h-6" />
              </div>
              <span className="text-sm font-medium text-green-600 flex items-center gap-1">
                <TrendingUp className="w-4 h-4" />
                {stat.change}
              </span>
            </div>
            <h3 className="text-2xl font-bold text-gray-900 mb-1">{stat.value}</h3>
            <p className="text-sm text-gray-600">{stat.title}</p>
          </div>
        ))}
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
        {/* Quick Links */}
        <div className="lg:col-span-1">
          <div className="bg-white rounded-xl border border-gray-200 p-6">
            <h2 className="text-xl font-semibold text-gray-900 mb-4">Quick Actions</h2>
            <div className="space-y-4">
              {quickLinks.map((link, index) => (
                <a
                  key={index}
                  href={link.link}
                  className="flex items-center gap-4 p-4 rounded-lg border border-gray-200 hover:border-primary/20 hover:shadow-lg transition-all"
                >
                  <div className="w-10 h-10 rounded-lg bg-primary/10 flex items-center justify-center">
                    <link.icon className="w-5 h-5 text-primary" />
                  </div>
                  <div className="flex flex-col items-start">
                    <span className="text-base font-medium text-gray-900">{link.title}</span>
                    <span className="text-sm text-gray-600">{link.description}</span>
                  </div>
                </a>
              ))}
            </div>
          </div>
        </div>

        {/* Recent Activity */}
        <div className="lg:col-span-2">
          <div className="bg-white rounded-xl border border-gray-200 overflow-hidden">
            <div className="p-6 border-b border-gray-200">
              <h2 className="text-xl font-semibold text-gray-900">Recent Activity</h2>
            </div>
            <div className="divide-y divide-gray-200">
              {recentActivity.map((activity, index) => (
                <div key={index} className="p-6 hover:bg-gray-50 transition-colors">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center gap-4">
                      <div className={`w-10 h-10 rounded-lg ${
                        activity.type === 'success' ? 'bg-green-100' : 'bg-blue-100'
                      } flex items-center justify-center`}>
                        <FileText className={`w-5 h-5 ${
                          activity.type === 'success' ? 'text-green-600' : 'text-blue-600'
                        }`} />
                      </div>
                      <div>
                        <h3 className="text-base font-medium text-gray-900">{activity.action}</h3>
                        <p className="text-sm text-gray-600">{activity.documentName}</p>
                      </div>
                    </div>
                    <div className="text-right">
                      <p className="text-sm font-medium text-gray-900">{activity.userName}</p>
                      <p className="text-sm text-gray-600">{activity.time}</p>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </DashboardLayout>
  );
};

export default Dashboard;
